import _ from 'lodash';
import React, { Component } from 'react';
import cardFields from './cardFields';
import Card from './Card';

class Cards extends Component {
    renderFields() {
		return _.map(cardFields, ({ key, label, image, text }) => {
			return <div className="col"><Card key={key} label={label} image={image} text="text" /></div> ;
		});
    }

	render() {
		return (
                <div className="row">
                {this.renderFields()}
                </div>
		);
	}
}

export default Cards;
